import React from 'react';
import { 
  BsSearch, 
  BsBarChart, 
  BsGear, 
  BsFileText,
  BsFilter,
  BsSave,
  BsTrash 
} from 'react-icons/bs';

// Criando componentes funcionais que retornam os ícones com estilo inline
export const SearchIcon = () => <BsSearch style={{ fontSize: '1.2rem' }} />;
export const ChartIcon = () => <BsBarChart style={{ fontSize: '1.2rem' }} />;
export const GearIcon = () => <BsGear style={{ fontSize: '1.2rem' }} />;
export const FileIcon = () => <BsFileText style={{ fontSize: '1.2rem' }} />;
export const FilterIcon = () => <BsFilter style={{ fontSize: '1.2rem' }} />;
export const SaveIcon = () => <BsSave style={{ fontSize: '1.2rem' }} />;
export const TrashIcon = () => <BsTrash style={{ fontSize: '1.2rem' }} />;

// Adicionando displayNames para depuração
SearchIcon.displayName = 'SearchIcon';
ChartIcon.displayName = 'ChartIcon';
GearIcon.displayName = 'GearIcon';
FileIcon.displayName = 'FileIcon';
FilterIcon.displayName = 'FilterIcon';
SaveIcon.displayName = 'SaveIcon';
TrashIcon.displayName = 'TrashIcon';
